import React from "react";
import './LandingPage.css'
import { Link } from 'react-router-dom';

function LandingPage(){
  return(
    <div>
      <div className="landing-page">
      <img className="l-page-img" src={require('./images/clone.png')}/>
      <Link to="/postview">
      <button className="l-page-btn">Go to My Page</button>
    </Link>
    </div>
    <img className="b-img" src="https://play-lh.googleusercontent.com/9ASiwrVdio0I2i2Sd1UzRczyL81piJoKfKKBoC8PUm2q6565NMQwUJCuNGwH-enhm00" />
    </div>
  )
}
export default LandingPage;
